'use strict';
const Moment = require('moment');

//とりあえず昼の休憩まで
const timeArray = [
  '8:45',
  '9:30',
  '9:35',
  '10:20',
  '10:45',
  '11:30',
  '11:35',
  '12:20',
  '13:00',
  '13:20',
  '13:40',
];

dispTime();

function dispTime() {
  var now = new Moment();
  document.getElementById('time').innerHTML = now.format('HH:mm:ss');
}

function dingdong() {
  var base64 = '';
  var sound = new Audio("data:audio/mp3;base64," + base64);
  sound.play();
}

function checkTime() {
  var now = new Moment();
  now = now.format('HH:mm');
  if (timeArray.includes(now)) {
    dingdong();
  }
}

setInterval(function () {
  dispTime();
}, 1000);

setInterval(function () {
  checkTime();
}, 60000);
